import { useState, useEffect } from 'react';
import { adminApi, setAuthToken } from '../../api'; // Update the path

const AdminDashboard = () => {
  useEffect(() => {
    // Set JWT token in headers before making any admin API requests
    setAuthToken();

    // Example: Fetch admin data
    adminApi.getData()
      .then(response => {
        console.log('Admin data:', response.data);
      })
      .catch(error => {
        console.error('Error fetching admin data:', error);
      });
  }, []); // Make sure to run this effect only once on component mount

  const handleOpenDoctorRegistration = () => {
    // Handle the logic to open the DoctorRegistration form
    console.log('Opening Doctor Registration form');
  };

  // Render your admin dashboard content here

  return (
    <div>
      <h1>Admin Dashboard</h1>
      {/* Add other components and functionality */}
      <button onClick={handleOpenDoctorRegistration}>
        Open Doctor Registration
      </button>
    </div>
  );
};

export default AdminDashboard;
